    /**
     * This is the right approach.... to clear with the highest change as possible... but due to time constraint it is giving
     * TLE for the last input in the test case.
     * <p>
     * So let's think of a Greedy approach.
     * but we need to consider few things.... we can never return 20 as change...since the max coin in this shop is
     * of 20 and you have to pay 5$ for lemonade..
     * So now we are left with 10 and 5.... coins now we know in this scenario how important lower demoninations coins are.
     * As a shop owner i would want to get rid of 10 instead of 5 as 5 coins give me more flexibility.
     * <p>
     * So let's look for the solution lemonadeChangeGreedy for different approach.
     *
     * @param bills
     * @return
     */
    public static boolean lemonadeChange(int[] bills) {
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>((A, B) -> B - A);
        Stack<Integer> stack = new Stack<>();
        for (int bill : bills) {
            stack = new Stack<>();
            if (bill - 5 > 0) {
                if (maxHeap.isEmpty()) return false; // We don't have change to give.
                int diff = bill - 5;
                while (diff > 0) {
                    if (maxHeap.isEmpty()) return false;
                    int top = maxHeap.poll();
                    if (top <= diff) {
                        diff -= top;
                    } else {
                        stack.push(top);
                    }
                }
                if (diff == 0) {
                    while (!stack.isEmpty()) {
                        maxHeap.add(stack.pop());
                    }
                }
            }
            maxHeap.add(bill);
        }
        return true;
    }

    public static boolean lemonadeChangeGreedy(int[] bills) {
        int five = 0, ten = 0;
        for (int bill : bills) {
            if (bill == 5) { // We got a 5 dollar
                five++;
            } else if (bill == 10) { // We got a 10 dollar
                five--;
                ten++;
            } else { // We got a 20 dollar
                if (ten > 0) {
                    five--;
                    ten--;
                } else {
                    five -= 3; // We have to give three 5 dollar as change.
                }
            }
            if (five < 0) return false;
        }
        return true;
    }
